export default class Home extends Component{
	render(){

		return(
				<div className='Home'> 
					<img alt='my face' src='https://imgur.com/0FlB2Nr.jpg' />
					<p> Hi Im Teddy. this is a portfolio i guess? </p>
				</div>
			)
	}
}
